import React, { useState } from "react";
import "./profile.css"; // Add styling as needed
import Header from "../header/header";
import Footer from "../footer/Footer";

const ProfilePage = () => {
  // State to track whether the profile is in edit mode
  const [isEditing, setIsEditing] = useState(false);

  // State to hold the input values
  const [profileData, setProfileData] = useState({
    fullName: "Mike Ross",
    email: "mikeross@gmail.com",
    gender: "Male",
    country: "India",
  });

  // Toggle the edit mode (edit/save button logic)
  const handleEditClick = () => {
    setIsEditing(!isEditing);
  };

  // Handle changes to the input fields
  const handleInputChange = (e) => {
    const { id, value } = e.target;
    setProfileData((prevState) => ({
      ...prevState,
      [id]: value,
    }));
  };

  return (
    <div className="all">
      <Header />

      {/* Main Banner */}
      <section className="profile">
        <div className="profile-header">
          <button className="back-button">&larr;</button>
          <h1>My Profile</h1>
        </div>

        {/* Profile Information Section */}
        <div className="profile-info">
          <div className="profile-pic-container">
            <img src="/images/Ellipse 11 (1).png" alt="Profile Pic" className="profile-pic" />
            <h2>{profileData.fullName}</h2>
            <button className="save-button" onClick={handleEditClick}>
              {isEditing ? "Save" : "Edit"}
            </button>
          </div>

          <form className="profile-form">
            <div className="form-group">
              <label htmlFor="fullName">Full Name</label>
              <input
                type="text"
                id="fullName" // Changed id to match profileData key
                value={profileData.fullName}
                onChange={handleInputChange}
                disabled={!isEditing}
              />
            </div>
            <div className="form-group">
              <label htmlFor="email">Email Address</label>
              <input
                type="email"
                id="email"
                value={profileData.email}
                onChange={handleInputChange}
                disabled={!isEditing}
              />
            </div>
            <div className="form-group">
              <label htmlFor="gender">Gender</label>
              <input
                type="text"
                id="gender"
                value={profileData.gender}
                onChange={handleInputChange}
                disabled={!isEditing}
              />
            </div>
            <div className="form-group">
              <label htmlFor="country">Country</label>
              <input
                type="text"
                id="country"
                value={profileData.country}
                onChange={handleInputChange}
                disabled={!isEditing}
              />
            </div>
          </form>
        </div>

        {/* Payment Methods Section */}
        <div className="payment-methods">
          <h3>Saved Payment Methods</h3>
          <div className="cards">
            <div className="card">
              <img src="/images/credit-card.png 2.png" alt="credit card" />
              <span>xxxx xxxx xxxx 1234</span>

              <a href="#edit">
                <img src="/images/edit.png" alt="edit" />
              </a>
            </div>
            <div className="card">
              <img src="/images/credit-card.png 2.png" alt="credit card" />
              <span>xxxx xxxx xxxx 6789</span>
              <a href="#edit">
                <img src="/images/edit.png" alt="edit" />
              </a>
            </div>
            <div className="card">
              <img src="/images/credit-card.png 2.png" alt="credit card" />
              <span>xxxx xxxx xxxx 3468</span>
              <a href="#edit">
                <img src="/images/edit.png" alt="edit" />
              </a>
            </div>
            <div className="card">
              <img src="/images/add 2.png" alt="add card" />
              <span>Add New Card</span>
            </div>
          </div>
        </div>
      </section>

      {/* Similar Restaurants */}
      <section className="restaurants">
        <div className="bc">
